import React, { useState } from 'react';
import axios from 'axios';
import '../css/Register.css';

function TasksRegister({ setTasks }) {
  const [formData, setFormData] = useState({
    tehtävä_nimi: '',
    max_aika: '',
  });
  const [newlyAddedTask, setNewlyAddedTask] = useState(null);

  const handleSubmit = (e) => {
    e.preventDefault();
  
    const maxAikaInSeconds = parseInt(formData.max_aika, 10);
    const maxAikaWithAdditionalZero = maxAikaInSeconds * 100;
  
    axios
      .post('http://localhost:3001/api/tehtavat', {
        ...formData,
        max_aika: maxAikaWithAdditionalZero.toString(),
      })
      .then((response) => {
        console.log('Task created:', response.data);
        setNewlyAddedTask(response.data);
        setFormData({
          tehtävä_nimi: '',
          max_aika: '',
        });
  
        handleAddTask(response.data);
      })
      .catch((error) => {
        console.error('Error creating task:', error);
      });
  };
  
  

  const handleInputChange = (e) => {
    const { name, value } = e.target;
    setFormData({
      ...formData,
      [name]: value,
    });
  };

  const handleAddTask = (newTask) => {
    setTasks((prevTasks) => {
    newTask.key = prevTasks.length;
      return [...prevTasks, newTask];
    });
  };
  
  return (
    <div className="register-container">
      <form onSubmit={handleSubmit}>
        <div className="form-row">
          <h2>Tehtävän lisäys</h2>

          <div className="form__group">
          
            <input
              type="text"
              className="form__field"
              id="tehtävä_nimi"
              name="tehtävä_nimi"
              placeholder="Tehtävän nimi"
              value={formData.tehtävä_nimi}
              onChange={handleInputChange}
              required
              autoComplete="off"
            />
            <label htmlFor="tehtävä_nimi" className="form__label">Tehtävä</label>
          </div>
          <div className="form__group">
            <input
              type="text"
              className="form__field"
              id="max_aika"
              name="max_aika"
              placeholder="Maksimi aika"
              value={formData.max_aika}
              onChange={handleInputChange}
              required
              autoComplete="off"
            />
            <label htmlFor="max_aika" className="form__label">Maksimi Aika</label>
          </div>
        </div>
        <button type="submit" className="submit-button">Lisää</button>
      </form>
      {newlyAddedTask && (
        <div className="newly-added-team">
          <h2>Uusi tehtävä lisätty:</h2>
          <p>Tehtävän Nimi: {newlyAddedTask.tehtävä_nimi}</p>
          <p>Maksimi Aika: {newlyAddedTask.max_aika}</p>
        </div>
      )}
            <ul>
        <li>60 = 1 min</li>
        <li>120 = 2 min</li>
        <li>180 = 3 min</li>
        <li>240 = 4 min</li>
        <li>300 = 5 min</li>
        <li>360 = 6 min</li>
        <li>420 = 7 min</li>
        <li>480 = 8 min</li>
        <li>540 = 9 min</li>
        <li>600 = 10 min</li>
        <li>660 = 11 min</li>
        <li>720 = 12 min</li>
        <li>780 = 13 min</li>
        <li>840 = 14 min</li>
        <li>900 = 15 min</li>
      </ul>
    </div>
  );
}

export default TasksRegister;
